import "./ExpenseForm";
const ExpenseForm = () => {
  return (
    <form>
      <div className="new-expense__controls">
        <div>
          <label className="new-expense__control label">Title</label>
          <input type="text" />
        </div>
        <div>
          <label>Amount</label>
          <input type="text" />
        </div>
        <div>
          <label>Date</label>
          <input type="text" />
        </div>
      </div>
    </form>
  );
};
export default ExpenseForm;
